                <span class="token comment">// 1. \u5C1D\u8BD5\u66F4\u65B0 next\uFF0C\u82E5 next.netxt != null \u8BF4\u660E\u53EF\u4EE5\u76F4\u63A5\u8FDB\u884C .next \u8FD4\u56DE</span>
